import RandomArray from "./components/RandomArray";
import InputArray from "./components/InputArray";
import ListOfActivities from "./components/ListOfActivities";
import ResultantArray from "./components/ResultantArray";
import CssBaseline from "@mui/material/CssBaseline";
import Box from "@mui/material/Box";
import Container from "@mui/material/Container";
import Header from "./components/Header";
import  Typography  from "@mui/material/Typography";

function App() {
  return (
    <>
      <CssBaseline />
      <Container fixed maxWidth="xl">
        <Box sx={{ bgcolor: "#cfe8fc", height: "100vh" }}>
          <Header />
          <RandomArray />
          <Typography variant="h5" textAlign={"center"}>
            OR
          </Typography>
          <InputArray />
          <ListOfActivities RandomArray = {<RandomArray />} userArray={<InputArray  />}/>
          <ResultantArray />
        </Box>
      </Container>
    </>
  );
}

export default App;
